import React from "react";
import "./Footer.css";

function Footer() {
  return (
    <footer class="bg-dark py-5 mt-5">
      <div class="container text-light text-center">
        <p class="display-5 mb-3">Sayagoy</p>
        <small class="text-white-50">&copy; saya.bakery</small>
      </div>
      <br />
      <br />

      <section class="footer">
        <div class="container">
          <div class="row">
            <div class="col-md-4 col-4"></div>
          </div>
        </div>
      </section>
    </footer>
  );
}
export default Footer;
